import { Fragment } from "react";
import classes from "./Header.module.css";
import HeaderCartButton from "./HeaderCartButton";
import underwater from "../../assets/underwater.jpg";
import { Link } from "react-scroll";
import ScrollToTop from "react-scroll-to-top";

const Header = (props) => {
  return (
    <Fragment>
      <header id="scrollup" className={classes.header}>
        <div>
          <ScrollToTop smooth />
          <h1>Evening View - Cocktail Bar</h1>
        </div>
        <HeaderCartButton onClick={props.onShownCart} />
      </header>
      <div className={classes.div}>
        <img className={classes.img} src={underwater}></img>
        <h2 className={classes.title}>Choose Your Favourite Cocktail</h2>
        <Link
          activeClass="active"
          to="scroll"
          spy={true}
          smooth={true}
          className={`${classes.section04} ${classes.demo}`}
        >
          <a href="#section05">
            <span></span>Scroll
          </a>
        </Link>
      </div>
    </Fragment>
  );
};

export default Header;
